}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">  <circle cx="12.0001" cy="12" r="11.5" fill="#f68d2b" stroke="#464646" stroke-miterlimit="10"/>  <polygon points="11.042 12.882 4.333 11.923 17.75 6.173 12 19.59 11.042 12.882" fill="#fff" stroke="#464646" stroke-miterlimit="10"/></svg>';
